function countdown(n){let o=[],e=new Date("2022/09/19 23:59:59");function t(n){return n<=9?"0"+n:n}o=document.getElementsByClassName(n),function n(){const r=e-+new Date;if(r<1e3)Array.from(o).forEach((function(n){n.innerHTML="countdown's over!"}));else{const e=new Date(r);let c=Math.floor(r/1e3),a=Math.floor(c/60),f=Math.floor(a/60);c%=60,a=(c>=30?a+1:a)%60,Array.from(o).forEach((function(n){n.innerHTML=(f?f+":"+t(a):a)+":"+t(c)})),setTimeout(n,e.getUTCMilliseconds()+500)}}()}countdown("app-timer");